import "./index.css";

export default function App() {
  return <Counter />;
}

function Counter() {
  return (
    <div className="counter">
      <div className="step">
        <button>-</button>
        <div>Step: </div>
        <button>+</button>
      </div>
      <div className="count">
        <button>-</button>
        <div>Count: </div>
        <button>+</button>
      </div>
    </div>
  );
}
